import React from "react";
import Quantity from "../Quantity";

const Footer = () => {
  return (
    <div className="footer">
      <Quantity />
      <div className="filters">
        <p>1</p>
        <p>2</p>
        <p>3</p>
      </div>
      <p className="completed">Completed items</p>
    </div>
  );
};

export default Footer;
